import React, { useState } from 'react';
import './App.css';

const App = () => {
  // États du formulaire
  const [formData, setFormData] = useState({
    kilometrage: '',
    anneeModele: '',
    nombrePortes: '',
    puissanceFiscale: '',
    premiereMain: false,
    typeBoite: 'manuelle',
    typeCarburant: 'essence',
    marque: '',
    modele: '',
    etat: 'Très bon',
    origine: 'Wilmaya'
  });

  const [prediction, setPrediction] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  // Options pour les selects
  const options = {
    etat: ['Très bon', 'Bon', 'Moyen', 'Mauvais'],
    typeBoite: ['manuelle', 'automatique'],
    typeCarburant: ['essence', 'diesel', 'électrique', 'hybride'],
    nombrePortes: ['3', '5']
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:8000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          kilometrage: parseFloat(formData.kilometrage) || 0,
          anneeModele: parseFloat(formData.anneeModele) || 0,
          nombrePortes: parseInt(formData.nombrePortes) || 0,
          puissanceFiscale: parseInt(formData.puissanceFiscale) || 0,
          premiereMain: formData.premiereMain,
          typeBoite: formData.typeBoite,
          typeCarburant: formData.typeCarburant,
          marque: formData.marque,
          modele: formData.modele,
          etat: formData.etat,
          origine: formData.origine
        }),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(
          data.detail ||
          data.message ||
          JSON.stringify(data) ||
          `Erreur ${response.status}: ${response.statusText}`
        );
      }

      setPrediction(data.prediction);

    } catch (err) {
      console.error('Erreur API:', err);
      setError(
        err.message ||
        'Une erreur est survenue lors de la prédiction'
      );
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="app">
      <h1>Prédiction du prix de voiture</h1>

      {error && (
        <div className="error">
          {typeof error === 'string' ? error : JSON.stringify(error)}
        </div>
      )}

      <form onSubmit={handleSubmit}>
        <div className="form-columns">
          {/* Colonne des champs numériques */}
          <div className="form-column">
            <h3>Informations techniques</h3>

            <div className="form-group">
              <label>Kilométrage *</label>
              <input
                type="number"
                name="kilometrage"
                value={formData.kilometrage}
                onChange={handleChange}
                min="0"
                required
              />
            </div>

            <div className="form-group">
              <label>Année-Modèle *</label>
              <input
                type="number"
                name="anneeModele"
                value={formData.anneeModele}
                onChange={handleChange}
                min="1990"
                max={new Date().getFullYear()}
                required
              />
            </div>

            <div className="form-group">
              <label>Nombre-de-portes</label>
              <select
                name="nombrePortes"
                value={formData.nombrePortes}
                onChange={handleChange}
              >
                <option value="">Sélectionnez</option>
                {options.nombrePortes.map(opt => (
                  <option key={opt} value={opt}>{opt}</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Puissance-fiscale (CV)</label>
              <input
                type="number"
                name="puissanceFiscale"
                value={formData.puissanceFiscale}
                onChange={handleChange}
                min="1"
              />
            </div>
          </div>

          {/* Colonne des caractéristiques */}
          <div className="form-column">
            <h3>Caractéristiques</h3>

            <div className="form-group checkbox-group">
              <input
                type="checkbox"
                id="premiereMain"
                name="premiereMain"
                checked={formData.premiereMain}
                onChange={handleChange}
              />
              <label htmlFor="premiereMain">Première-main</label>
            </div>

            <div className="form-group">
              <label>Type boîte</label>
              <select
                name="typeBoite"
                value={formData.typeBoite}
                onChange={handleChange}
              >
                {options.typeBoite.map(opt => (
                  <option key={opt} value={opt}>
                    {opt.charAt(0).toUpperCase() + opt.slice(1)}
                  </option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Type carburant</label>
              <select
                name="typeCarburant"
                value={formData.typeCarburant}
                onChange={handleChange}
              >
                {options.typeCarburant.map(opt => (
                  <option key={opt} value={opt}>
                    {opt.charAt(0).toUpperCase() + opt.slice(1)}
                  </option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Marque *</label>
              <input
                type="text"
                name="marque"
                value={formData.marque}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label>Modèle</label>
              <input
                type="text"
                name="modele"
                value={formData.modele}
                onChange={handleChange}
              />
            </div>

            <div className="form-group">
              <label>État</label>
              <select
                name="etat"
                value={formData.etat}
                onChange={handleChange}
              >
                {options.etat.map(opt => (
                  <option key={opt} value={opt}>{opt}</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Origine</label>
              <input
                type="text"
                name="origine"
                value={formData.origine}
                onChange={handleChange}
              />
            </div>
          </div>
        </div>

        <button
          type="submit"
          className="submit-btn"
          disabled={isLoading}
        >
          {isLoading ? 'Calcul en cours...' : 'Prédire le prix'}
        </button>
      </form>

      {prediction !== null && (
        <div className="prediction-result">
          <h2>Résultat de la prédiction</h2>
          <p className="price">{Math.round(prediction).toLocaleString()} €</p>
          <p className="disclaimer">* Estimation basée sur les informations fournies</p>
        </div>
      )}
    </div>
  );
};

export default App;
